// 电子证照授权码
export async function getCertificateAuthCode(data) {
  return request({
    url: "/web/api/certificate/authenticate", method: "post", data: {
      ...data, ...mock,
    }
  })
}
// 检查是否已经存在电子证照授权码
export async function checkCertificateAuthCode(data) {
  return request({
    url: "/web/api/certificate/findAuthCode", method: "GET", params: {
      ...data, ...mock,
    }
  });
}
